import React from 'react';
import styles from './Detailcss.module.css' 

const Todo =({children})=>{
    
    return(
        <div className={`${styles.Todo-template} `}>
            <div className={`${styles.title-n}` }> 
                Today List
            </div>
            <div className={`${styles.content}`}>
                {children}
            </div>
    
        </div>
    )
}

export default Todo;
